DROP TABLE "sys_fphp_account";
CREATE TABLE "sys_fphp_account" (
  "Id" NUMBER GENERATED by default on null as IDENTITY (START WITH 2) PRIMARY KEY,
  "UUID" VARCHAR2(36) NOT NULL,
  "Mail" VARCHAR2(255) DEFAULT NULL,
  "LanguageCode" VARCHAR2(255) DEFAULT NULL,
  "Joined" TIMESTAMP NULL,
  "LastLogin" TIMESTAMP NULL,
  CONSTRAINT "sys_fphp_account_uuid_unique" UNIQUE ("UUID")
);

