  "KeepFilter" CHAR(1) DEFAULT NULL,
  "PermissionInheritance" CHAR(1) DEFAULT NULL,
  "MaintenanceMode" CHAR(1) DEFAULT NULL,
  "MaintenanceModeMessage" VARCHAR2(255) DEFAULT NULL,
  CONSTRAINT "sys_fphp_branch_unique" UNIQUE ("Name","ParentBranch","NavigationOrder")
);

