DROP TABLE "sys_fphp_checkout";
CREATE TABLE "sys_fphp_checkout" (
  "Id" NUMBER GENERATED by default on null as IDENTITY PRIMARY KEY,
  "UUID" VARCHAR2(36) NOT NULL,
  "ForeignUUID" VARCHAR2(36) NOT NULL,
  "Timestamp" TIMESTAMP NULL,
  "UserUUID" VARCHAR2(36) DEFAULT NULL,
  CONSTRAINT "sys_fphp_checkout_uuid_unique" UNIQUE ("UUID"),
