);


DROP TABLE "sys_fphp_files";
CREATE TABLE "sys_fphp_files" (
  "Id" NUMBER GENERATED by default on null as IDENTITY PRIMARY KEY,
  "UUID" VARCHAR2(36) NOT NULL,
  "BranchId" INTEGER NOT NULL,
  "ForeignUUID" VARCHAR2(36) NOT NULL,
  "Name" VARCHAR2(255) NOT NULL,
  "DisplayName" VARCHAR2(255) DEFAULT NULL,
  "Major" SMALLINT  NOT NULL,
  "Minor" SMALLINT  NOT NULL,
  "Created" TIMESTAMP NULL,
  "CreatedBy" VARCHAR2(36) DEFAULT NULL,
  "Modified" TIMESTAMP NULL,
  "ModifiedBy" VARCHAR2(36) DEFAULT NULL,
  CONSTRAINT "sys_fphp_files_uuid_unique" UNIQUE ("UUID"),
  CONSTRAINT "sys_fphp_files_unique" UNIQUE ("BranchId","ForeignUUID","Name","Major","Minor")
);


DROP TABLE "sys_fphp_flex";
CREATE TABLE "sys_fphp_flex" (
  "Id" NUMBER GENERATED by default on null as IDENTITY PRIMARY KEY,
  "UUID" VARCHAR2(36) NOT NULL,
  "TableUUID" VARCHAR2(36) NOT NULL,
  "FieldName" VARCHAR2(255) DEFAULT NULL,
  "Top" SMALLINT  NOT NULL,
  "Left" SMALLINT  NOT NULL,
  "Width" SMALLINT  NOT NULL,
  "Height" SMALLINT  NOT NULL,
  CONSTRAINT "sys_fphp_flex_uuid_unique" UNIQUE ("UUID"),
  CONSTRAINT "sys_fphp_flex_unique" UNIQUE ("TableUUID","FieldName")
);


DROP TABLE "sys_fphp_forestdata";
