DROP TABLE "sys_fphp_formkey";
CREATE TABLE "sys_fphp_formkey" (
  "Id" NUMBER GENERATED by default on null as IDENTITY PRIMARY KEY,
  "UUID" VARCHAR2(36) NOT NULL,
  "SessionUUID" VARCHAR2(36) NOT NULL,
  "Timestamp" TIMESTAMP DEFAULT CURRENT_TIMESTAMP NOT NULL,
  "BranchId" INTEGER DEFAULT NULL,
  "ActionId" INTEGER DEFAULT NULL,
  "FormId" VARCHAR2(255) NOT NULL,
  CONSTRAINT "sys_fphp_formkey_unique" UNIQUE ("UUID","SessionUUID","Timestamp","FormId")
);


DROP TABLE "sys_fphp_identifier";
CREATE TABLE "sys_fphp_identifier" (
  "Id" NUMBER GENERATED by default on null as IDENTITY PRIMARY KEY,
  "UUID" VARCHAR2(36) NOT NULL,
  "IdentifierName" VARCHAR2(255) NOT NULL,
  "IdentifierStart" VARCHAR2(255) NOT NULL,
  "IdentifierNext" VARCHAR2(255) NOT NULL,
  "IdentifierIncrement" SMALLINT  NOT NULL,
  CONSTRAINT "sys_fphp_identifier_uuid_unique" UNIQUE ("UUID"),
  CONSTRAINT "sys_fphp_identifier_unique" UNIQUE ("IdentifierName")
);


DROP TABLE "sys_fphp_language";
CREATE TABLE "sys_fphp_language" (
  "Id" NUMBER GENERATED by default on null as IDENTITY (START WITH 4) PRIMARY KEY,
  "UUID" VARCHAR2(36) NOT NULL,
  "Code" VARCHAR2(8) NOT NULL,
  "Language" VARCHAR2(32) DEFAULT NULL,
  CONSTRAINT "sys_fphp_language_uuid_unique" UNIQUE ("UUID"),
  CONSTRAINT "sys_fphp_language_unique" UNIQUE ("Code","Language")
);

