DROP TABLE "sys_fphp_log";
CREATE TABLE "sys_fphp_log" (
  "Id" NUMBER GENERATED by default on null as IDENTITY PRIMARY KEY,
  "UUID" VARCHAR2(36) NOT NULL,
  "Branch" VARCHAR2(255) DEFAULT NULL,
  "Created" TIMESTAMP NULL,
  "CreatedBy" VARCHAR2(36) DEFAULT NULL,
  "Action" VARCHAR2(255) DEFAULT NULL,
  "Session" VARCHAR2(255) DEFAULT NULL,
  "Event" CLOB,
  CONSTRAINT "sys_fphp_log_uuid_unique" UNIQUE ("UUID")
);


DROP TABLE "sys_fphp_permission";
CREATE TABLE "sys_fphp_permission" (
  "Id" NUMBER GENERATED by default on null as IDENTITY (START WITH 448) PRIMARY KEY,
  "UUID" VARCHAR2(36) NOT NULL,
  "Name" VARCHAR2(255) DEFAULT NULL,
  "Created" TIMESTAMP NULL,
  "CreatedBy" VARCHAR2(36) DEFAULT NULL,
  "Modified" TIMESTAMP NULL,
  "ModifiedBy" VARCHAR2(36) DEFAULT NULL,
  "Branch" VARCHAR2(255) DEFAULT NULL,
  "Action" VARCHAR2(255) DEFAULT NULL,
  CONSTRAINT "sys_fphp_permission_uuid_unique" UNIQUE ("UUID")
);

