DROP TABLE "sys_fphp_table";
CREATE TABLE "sys_fphp_table" (
  "Id" NUMBER GENERATED by default on null as IDENTITY (START WITH 83) PRIMARY KEY,
  "UUID" VARCHAR2(36) NOT NULL,
  "Name" VARCHAR2(255) NOT NULL,
  "Identifier" VARCHAR2(255) DEFAULT NULL,
  "Unique" VARCHAR2(2048) DEFAULT NULL,
  "SortOrder" VARCHAR2(2048) DEFAULT NULL,
  "Interval" SMALLINT  DEFAULT NULL,
  "View" VARCHAR2(2048) DEFAULT NULL,
  "SortColumn" VARCHAR2(255) DEFAULT NULL,
  "InfoColumns" SMALLINT  NOT NULL,
  "InfoColumnsView" SMALLINT  NOT NULL,
  "Versioning" SMALLINT  NOT NULL,
  "CheckoutInterval" VARCHAR2(255) DEFAULT NULL,
  CONSTRAINT "sys_fphp_table_uuid_unique" UNIQUE ("UUID")
);

